import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

function Output(){
  return (
    <div>
        <h1><App/></h1>
    </div>
  )
}

ReactDOM.render(<Output/>, document.getElementById("root"))
